      fontFamily: designTokens.typography.fontFamily,
      padding: designTokens.spacing.vertical.xl,
      backgroundColor: designTokens.colors.neutral.background[1].rest
    }}>
      <h1 style={{ ...designTokens.typography.largeTitle.regular, color: designTokens.colors.neutral.foreground[1].rest }}>
        Design System Style Guide
      </h1>

      {/* Colors Section */}
      <section style={{ marginBottom: designTokens.spacing.vertical.xxl }}>
        <h2 style={{ ...designTokens.typography.title2.regular, color: designTokens.colors.neutral.foreground[1].rest }}>
          Colors
        </h2>
        
        {/* Neutral Colors */}
        <div>
          <h3 style={{ ...designTokens.typography.subtitle1.regular }}>Neutral Colors</h3>
